--## INCIDENCIA_LINK=CMREC-3137
--## PRODUCTO=NO
--## Finalidad: DML
--##           
--## INSTRUCCIONES: Configurar las variables necesarias en el principio del DECLARE
--## VERSIONES:
--##        0.1 Versi√≥n inicial
--##########################################
--*/
WHENEVER SQLERROR EXIT SQL.SQLCODE;
SET SERVEROUTPUT ON

DECLARE

    V_SQL VARCHAR2(32000 CHAR); -- Sentencia a ejecutar
    V_ESQUEMA VARCHAR2(25 CHAR):= 'CM01'; -- Configuracion Esquemas
    V_ESQUEMA_MASTER VARCHAR2(25 CHAR):= 'CMMASTER'; -- Configuracion Esquemas
    V_NUM_TABLAS NUMBER(16); -- Vble. para validar la existencia de una tabla.
    ERR_NUM NUMBER(25);  -- Vble. auxiliar para registrar errores en el script.
    ERR_MSG VARCHAR2(1024 CHAR); -- Vble. auxiliar para registrar errores en el script.

    USUARIO varchar2(50 CHAR) := 'CMREC-3137:UPDATE SUB FECHAS SENYALAM POST-MIGRA';
    
    V_COUNT_SUB NUMBER := 0;
    V_COUNT_TEV NUMBER := 0;
    
    v_TEV_ID    NUMBER;
    v_TEV_VALOR_DATE DATE;

    CURSOR C1 IS SELECT SUB.SUB_ID, SUB.PRC_ID, TRUNC(SUB.SUB_FECHA_SENYALAMIENTO) AS SUB_FECHA_SENYALAMIENTO, TMP.FECHA_SENYALAMIENTO
                 FROM CM01.SUB_SUBASTA SUB, CM01.TMP_SUB_FECHA_SENYALAMIENTO TMP, CM01.ASU_ASUNTOS ASU
                 WHERE SUB.ASU_ID = ASU.ASU_ID
                 AND ASU.ASU_ID_EXTERNO = TO_CHAR(TMP.CD_PROCEDIMIENTO);
                
                
BEGIN

      SELECT COUNT(1)
      INTO V_NUM_TABLAS
      FROM ALL_TABLES
      WHERE TABLE_NAME = 'TMP_SUB_FECHA_SENYALAMIENTO';
      
      IF V_NUM_TABLAS = 1 THEN
      
        EXECUTE IMMEDIATE('TRUNCATE TABLE '||V_ESQUEMA||'.TMP_SUB_FECHA_SENYALAMIENTO');
        
      END IF;


COMMIT;

    FOR j IN C1 LOOP
    
        IF j.SUB_FECHA_SENYALAMIENTO <> j.FECHA_SENYALAMIENTO THEN
        
        
            UPDATE CM01.SUB_SUBASTA
               SET SUB_FECHA_SENYALAMIENTO = j.FECHA_SENYALAMIENTO,
                   USUARIOMODIFICAR = 'CMREC-3137:UPDATE SUB FECHAS SENYALAM POST-MIGRA',
                   FECHAMODIFICAR = SYSDATE
              WHERE SUB_ID = j.SUB_ID;
      
            V_COUNT_SUB := V_COUNT_SUB + 1;

        END IF;
        
        BEGIN
        
              SELECT DISTINCT TEV.TEV_ID, NVL(TO_DATE(TEV.TEV_VALOR,'YYYY-MM-DD'),TO_DATE('1900-01-01','YYYY-MM-DD')) AS TEV_VALOR
              INTO v_TEV_ID, v_TEV_VALOR_DATE
              FROM CM01.TAR_TAREAS_NOTIFICACIONES TAR, CM01.TEX_TAREA_EXTERNA TEX, CM01.TEV_TAREA_EXTERNA_VALOR TEV, CM01.TAP_TAREA_PROCEDIMIENTO TAP
              WHERE TAR.PRC_ID = j.PRC_ID
              AND TAR.TAR_ID = TEX.TAR_ID
              AND TEX.TAP_ID = TAP.TAP_ID
              AND TAP.TAP_CODIGO = 'H002_SenyalamientoSubasta'
              AND TEX.TEX_ID = TEV.TEX_ID
              AND TEV.TEV_NOMBRE = 'fechaSenyalamiento';
        
        EXCEPTION
            WHEN NO_DATA_FOUND THEN
            
                V_COUNT_TEV := V_COUNT_TEV - 1;
                
        END;
        
        IF j.FECHA_SENYALAMIENTO <> v_TEV_VALOR_DATE THEN
        
            UPDATE CM01.TEV_TAREA_EXTERNA_VALOR
               SET TEV_VALOR = TO_CHAR(j.FECHA_SENYALAMIENTO,'YYYY-MM-DD'),
                   USUARIOMODIFICAR = 'CMREC-3137:UPDATE SUB FECHAS SENYALAM POST-MIGRA',
                   FECHAMODIFICAR = SYSDATE        
              WHERE TEV_ID = v_TEV_ID;

            V_COUNT_TEV := V_COUNT_TEV + 1;
            
        END IF;
        
    END LOOP;
    
    DBMS_OUTPUT.PUT_LINE('V_COUNT_SUB = '||V_COUNT_SUB);
    DBMS_OUTPUT.PUT_LINE('V_COUNT_TEV = '||V_COUNT_TEV);
    
    COMMIT;
    
END;
/
EXIT;
